import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import ToggleLink from './links/ToggleLink';

const Navbar = () => {

  return (
    <nav className="navbar">
      <Logo first="ABE" last="CHOI"/>
      <ul>
        <li><a>PROJECTS</a></li>
        <li><a>DOCS</a></li>
        <li><a>BLOGS</a></li>
        <li><a>ABOUT</a></li>
        <li><ToggleLink /></li>
      </ul>
    </nav>
  );
}

export default Navbar;
